import React from 'react'

const HomeNav = () => {
  return (
    <div class="w-screen h-[60px] fixed flex items-center">
        <h1 className='font-poppins font-semibold italic text-[24px] mx-[5%]'> Episkey </h1>
    </div>
  )
}

export default HomeNav
